import { Model} from 'acey'

class CounterModel extends Model {
  constructor(data, options){
    super(data, options)
  }

  get = () => this.state.counter

}

const Counter = new CounterModel({counter: 0}, {connected: true, key: 'counter'})


export default function Home() {
  return (
    <div>
      {Counter.get()}
    </div>
  )
}
